public Class<? extends GetSpaceUsed> getKlass() {
  if (klass != null) {
    return klass;
  }
  Class<? extends GetSpaceUsed> result = null;
  if (Shell.WINDOWS) {
    result = WindowsGetSpaceUsed.class;
  } else {
    result = DU.class;
  }
  if (conf == null) {
    return result;
  }
  return conf.getClass(CLASSNAME_KEY, result, GetSpaceUsed.class);
}
